import {Row, Col} from 'react-bootstrap'

function Iletisim() {
 return (
  <Layout title={"İletişim"} headText={"İletişim"}>
     <Row>
        <Col lg={4}>
        yazi
        </Col>
        <Col lg={8}>
           yazi
        </Col>
     </Row>
  </Layout>
 );
}

export default Iletisim;
